                     <img src={ mblogo }  className="d-inline-block align-top" alt="" />
                        <ul className="nav_ul">
                            <li>Find a Brewery</li>
                            <li>About MongoByte</li>
                            <li>Contact Us</li>
                        </ul> 
                  {/*  </a> */}
                </nav>
            </div>
        );
    };


export default navbar;
